"      Padexol (KP);",
"     </li>",
"     <li>",
"      Panataxel (EC);",
"     </li>",
"     <li>",
"      Parexel (CO, PY);",
"     </li>",
"     <li>",
"      Paxel (KP, PH);",
"     </li>",
"     <li>",
"      Paxene (AT, BE, BG, CH, CZ, DE, DK, EE, ES, FI, FR, GB, GR, HN, IE, IT, MT, NL, NO, PL, PT, RU, SE, SK, TR);",
"     </li>",
"     <li>",
"      Paxus (ID);",
"     </li>",
"     <li>",
"      Praxel (CN, MX, TH);",
"     </li>",
"     <li>",
"      Sindaxel (BG, HK, ID, TH);",
"     </li>",
"     <li>",
"      Taxocris (UY);",
"     </li>",
"     <li>",
"      Taxol (AR, AT, AU, BE, CH, CL, CO, CZ, DE, DK, EE, ES, FI, FR, GR, HK, HN, IT, KP, NL, NO, NZ, PK, PL, RU, SE, TH, TR, ZA)",
"     </li>",
