"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F205544\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Paclitaxel promotes microtubule assembly by enhancing the action of tubulin dimers, stabilizing existing microtubules, and inhibiting their disassembly, interfering with the late G",
"     <sub>",
"      2",
"     </sub>",
"     mitotic phase, and inhibiting cell replication. In addition, the drug can distort mitotic spindles, resulting in the breakage of chromosomes. Paclitaxel may also suppress cell proliferation and modulate immune response.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F205562\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     V",
"     <sub>",
"      d",
"     </sub>",
"     : Widely distributed into body fluids and tissues; affected by dose and duration of infusion",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     V",
"     <sub>",
"      dss",
"     </sub>",
"     :",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     1- to 6-hour infusion: 67.1 L/m",
"     <sup>",
"      2",
"     </sup>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     24-hour infusion: 227-688 L/m",
"     <sup>",
"      2",
"     </sup>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 89% to 98%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via CYP2C8 and 3A4; forms metabolites (primarily 6&alpha;-hydroxypaclitaxel)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1- to 6-hour infusion: Mean (beta): 6.4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     3-hour infusion: Mean (terminal): 13.1-20.2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     24-hour infusion: Mean (terminal): 15.7-52.7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Feces (~70%, 5% as unchanged drug); urine (14%)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Clearance: Mean: Total body: After 1- and 6-hour infusions: 5.8-16.3 L/hour/m",
"     <sup>",
"      2",
"     </sup>",
"     ; After 24-hour infusions: 14.2-17.2 L/hour/m",
"     <sup>",
"      2",
"     </sup>",
"    </p>",
"   </div>",
