var title_f16_58_17321="Basic vertebral anatomy";
var content_f16_58_17321=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F58088&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F58088&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 626px\">",
"   <div class=\"ttl\">",
"    Basic vertebral anatomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 606px; height: 456px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A \"typical\" vertebra, represented by L2.",
"    <br>",
"     (A) Functional components include the vertebral body (bone color), a vertebral arch (red), and seven processes: three for muscle attachment and leverage (blue) and four that participate in synovial joints with adjacent vertebrae (yellow).",
"     <br>",
"      (B, C) Bony formations of the vertebrae are demonstrated. The vertebral foramen is bounded by the vertebral arch and body. A small superior vertebral notch and a larger inferior vertebral notch flank the pedicle.",
"      <br>",
"       (D) The superior and inferior notches of adjacent vertebrae plus the IV disc that unites them form the IV foramen for the passage of a spinal nerve and its accompanying vessels. Note that each articular process has an articular facet where contact occurs with the articular facets of adjacent vertebrae (B-D).",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"        Reproduced with permission from: Moore KL, Dalley AF. Clinically Oriented Anatomy, 5th ed, Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"       </div>",
"       <div class=\"contractual\">",
"        <br/>",
"        <a href=\"file://www.lww.com\">",
"         file://www.lww.com",
"        </a>",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
