var title_f16_58_17325="NASCET endarterectomy stroke death";
var content_f16_58_17325=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F67964&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F67964&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Carotid endarterectomy reduces major stroke and death in symptomatic patients with severe stenosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 359px; height: 256px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The North American Symptomatic Carotid Endarterectomy Trial (NASCET)&nbsp;included 659 patients with a recent transient ischemic attack or nondisabling stroke and a 70 to 99 percent carotid stenosis who were randomly assigned to carotid endarterectomy or medical therapy. At two year follow-up, the cumulative risk of a major stroke or death was significantly lower in the endarterectomy group compared with the medical treatment group (8.0 versus 19.1 percent). The Kaplan-Meier survival curve shows the probability of event-free survival after randomization at six month intervals.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: North American Symptomatic Carotid Endarterectomy Trial Collaborators. N Engl J Med 1991; 325:445.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f16_58_17325=[""].join("\n");
var outline_f16_58_17325=null;
var title_f16_58_17326="Corticosteroid drug interact";
var content_f16_58_17326=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F53228&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F53228&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major drug interactions with systemic glucocorticoids*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Interacting class",
"       </td>",
"       <td class=\"subtitle1\">",
"        Sample agents",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Co-administration of drugs that are strong inducers of CYP 3A may DECREASE glucocorticoid exposure and efficacy",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anticonvulsants",
"       </td>",
"       <td>",
"        Carbamazepine, fosphenytoin, oxcarbazepine, pentobarbital, phenobarbital, phenytoin, primidone",
"       </td>",
"       <td rowspan=\"3\">",
"        Reduced glucocorticoid effects due to accelerated clearance. Maximal effect of interaction occurs approximately two weeks after initiating a strong CYP inducer. Induction effects may persist for weeks following discontinuation of a strong CYP inducer.",
"       </td>",
"       <td>",
"        Methylprednisolone clearance may be increased by &gt;200 percent by interacting anticonvulsants, significantly decreasing glucocorticoid exposure. Dose alteration of methylprednisolone may be needed. Prednisone and prednisolone are affected considerably less by this interaction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anti-infectives",
"       </td>",
"       <td>",
"        Efavirenz, etravirine, nafcillin, nevirapine, rifampin, rifabutin, rifapentine",
"       </td>",
"       <td>",
"        Methylprednisolone, prednisone, and prednisolone exposure may be decreased by as much as 60 percent following rifampin co-administration. Rifampin interacts more significantly than rifabutin or rifapentine.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Other",
"       </td>",
"       <td>",
"        Bosentan, St. John's wort",
"       </td>",
"       <td>",
"        Reduced glucocorticoid exposure is possible. However, no clinical data are available.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Orally administered antacids may decrease bioavailability of orally administered glucocorticoids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Oral antacids",
"       </td>",
"       <td>",
"        Aluminum hydroxide, calcium carbonate, magnesium hydroxide, others",
"       </td>",
"       <td>",
"        Potentially reduced glucocorticoid effects due to decreased oral absorption. Variable effects reported.",
"       </td>",
"       <td>",
"        Separating administration of oral glucocorticoids from antacids by two or more hours may minimize this interaction.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Co-administration of drugs that are strong inhibitors of CYP 3A and/or P-gp may INCREASE glucocorticoid exposure and toxicity",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antibiotics",
"       </td>",
"       <td>",
"        Clarithromycin, telithromycin",
"       </td>",
"       <td rowspan=\"4\">",
"        Increased glucocorticoid effects due to decreased clearance",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Methylprednisolone and dexamethasone clearance may be reduced by approximately 30 to 50 percent. Monitor biomarkers for exaggerated glucocorticoid effects.",
"         <sup>",
"          &Delta;",
"         </sup>",
"         Dose alteration of methylprednisolone and dexamethasone may be needed. No specific recommendation available.",
"        </p>",
"        <p>",
"         Prednisone and prednisolone are not affected to a clinically relevant degree by this interaction.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antifungals",
"       </td>",
"       <td>",
"        Itraconazole, ketoconazole, posaconazole, voriconazole",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antimycobacterial",
"       </td>",
"       <td>",
"        Isoniazid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antivirals (including HIV and HCV)",
"       </td>",
"       <td>",
"        Atazanavir, boceprevir, darunavir, delavirdine, fosamprenavir, indinavir, lopinavir, nelfinavir, ritonavir, saquinavir, telaprevir",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Estrogens",
"       </td>",
"       <td>",
"        Estrogen containing oral contraceptives, conjugated estrogens, esterified estrogens, others",
"       </td>",
"       <td>",
"        Estrogens can significantly increase glucocorticoid exposure and effects. This may be due to alteration of steroid metabolism and protein binding.",
"       </td>",
"       <td>",
"        Monitor biomarkers for exaggerated glucocorticoid effects.",
"        <sup>",
"         &Delta;",
"        </sup>",
"        Dose alteration of glucocorticoid may be needed. No specific recommendation available.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Immunosuppressants",
"       </td>",
"       <td>",
"        Cyclosporine, tacrolimus, everolimus",
"       </td>",
"       <td>",
"        Increased exposure to methylprednisolone, prednisone, and prednisolone. Other effects described include increased and decreased cyclosporine concentrations and decreased everolimus concentrations with dexamethasone.",
"       </td>",
"       <td>",
"        <p>",
"         Monitor biomarkers for exaggerated glucocorticoid effects.",
"         <sup>",
"          &Delta;",
"         </sup>",
"         Dose alteration may be needed. No specific recommendation available.",
"        </p>",
"        <p>",
"         Monitor immunosuppressant concentrations closely. If possible, avoid dexamethasone with everolimus. For additional information see \"Pharmacology and side effects of cyclosporine and tacrolimus.\"",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Multiple effects or additive toxicities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anticoagulants, oral",
"       </td>",
"       <td>",
"        Warfarin",
"       </td>",
"       <td>",
"        Glucocorticoids may increase anticoagulant effect of warfarin by multiple mechanisms",
"       </td>",
"       <td>",
"        Most patients stabilized on warfarin will require a significant alteration in warfarin dose within three to seven days after initiating glucocorticoid. Monitor INR closely to determine need for dose adjustment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Diuretics, potassium wasting",
"       </td>",
"       <td>",
"        Furosemide, hydrochlorothiazide, others",
"       </td>",
"       <td>",
"        Glucocorticoids may enhance the kaluretic effects of potassium wasting diuretics",
"       </td>",
"       <td>",
"        Evaluate serum potassium levels to determine whether alteration of diuretic therapy and/or potassium supplementation is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fluoroquinolone anti-infectives",
"       </td>",
"       <td>",
"        Ciprofloxacin, gemifloxacin, levofloxacin, moxifloxacin, ofloxacin, sparfloxacin, others",
"       </td>",
"       <td>",
"        Increased risk of developing tendonitis and rupture",
"       </td>",
"       <td>",
"        Monitor for new onset tendon and/or joint pain. Use fluoroquinolones with glucocorticoids cautiously in older adults and children.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypoglycemic agents (oral and insulin)",
"       </td>",
"       <td>",
"        Acarbose, glipizide, glyburide, insulins, metformin, pioglitazone, sitagliptin, others",
"       </td>",
"       <td>",
"        Initiation of glucocorticoid treatment may result in glucose dysregulation",
"       </td>",
"       <td>",
"        Closely monitor blood glucose in patients at risk for glycemic dysregulation. Adjust hypoglycemic agents based on blood glucose results.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nonsteroidal antiinflammatory drugs (NSAIDs)",
"       </td>",
"       <td>",
"        Ibuprofen, indomethacin, ketorolac, ketoprofen, naproxen, others",
"       </td>",
"       <td>",
"        Increased risk of peptic ulcer disease when glucocorticoids are used in combination with an NSAID, compared with the use of either alone",
"       </td>",
"       <td>",
"        See \"Major side effects of systemic glucocorticoids,\" section 'Gastrointestinal tract.'",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    This table does not show all possible interactions. For additional interactions and information including management suggestions, see Lexi-Interact&trade; program included with UpToDate. Interaction data and recommendations refer to systemic drug forms.",
"    <div class=\"footnotes\">",
"     CYP 3A4: cytochrome P450 3A4; P-gp: P-glycoprotein efflux membrane transporters; HCV: hepatitis C virus; HIV: human immunodeficiency virus; NSAID: nonsteroidal antiinflammatory drug; INR: international normalized ratio.",
"     <br>",
"      * No significant interactions with azathioprine, methotrexate, histamine",
"      <sub>",
"       2",
"      </sub>",
"      antagonists (eg, famotidine, cimetidine, ranitidine), or proton pump inhibitors (eg, omeprazole, pantoprazole, rabeprazole).",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       For a list of CYP 3A4 inducers/inhibitors, see other table: \"Inhibitors and inducers of cytochrome P450 3A4.\"",
"       <br>",
"        &Delta; Biomarkers of glucocorticoid toxicity may include neuropsychiatric reactions, fluid and electrolyte disturbances, hypertension, and/or hyperglycemia.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Czock D, et al. Pharmacokinetics and pharmacodynamics of systemically administered glucocorticoids; Clin Pharmacokinet 2005; 44:61. Lexicomp Online. Copyright &copy; 1978-2013 Lexicomp, Inc. All Rights Reserved; Wynn GH, et al (Eds). Clinical Manual of Drug Interaction Principles for Medical Practice APA publishing, Washington DC. Copyright &copy; 2009.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
