"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/imagelibrary/Filariasis_il.htm\" style=\"font-style: italic;\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/imagelibrary/Filariasis_il.htm",
"     </a>",
"     .",
"    </div>",
